/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Username` varchar(12) NOT NULL,
  `Password` varchar(12) NOT NULL,
  `Secret_Question` varchar(50) NOT NULL,
  `Secret_Answer` varchar(50) NOT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `UQ_tbl_users_Username` (`Username`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `users` */

insert  into `users`(`Id`,`Username`,`Password`,`Secret_Question`,`Secret_Answer`) values (5,'admin','admin','What is your favorite color?','black'),(6,'asd','asd','What is your contact number?','12');

